import React, { useState } from 'react';
import styled, { css } from 'styled-components';
import { RiLogoutCircleLine } from 'react-icons/ri';

const CircleButton = styled.button`
    background: #3866d9;
    &:hover {
        background: #6382e6; 
    }

    z-index: 6;
    cursor: pointer;
    width: 50px;
    height: 50px;
    display: block;
    justify-content: center;
    font-size: 60px;
    position: absolute;
    left: 50%;
    bottom: 0px;
    transform: translate(-50%, -1480%);
    color: white;
    border-radius: 50%;
    border: none;
    outline: none;
    display: flex;
    align-items: center;
    justify-content: center;

    transition: 0.125s all ease-in;
`;

function TodoLogout() {
    return (
        <>
            <CircleButton>
                <RiLogoutCircleLine />
            </CircleButton>
        </>
    );
}

export default TodoLogout;
